import React from "react";

const ImageLinkForm = () => {
  return (
    <div className="imageLinkForm">
      <p className="f3">Select an Image and let's see if it have face</p>
      <div className="center w-90">
        <input className="f4 pa2 w-70 br2 center" type="text"></input>
        <button className="w-30 grow br2 f4 ph3 link pv2 bg white bg-light-purple dib b--white ba bw1">
          Detect
        </button>
      </div>
    </div>
  );
};
export default ImageLinkForm;
